
-- Sample MySQL Table Schema
CREATE TABLE users (
    id INT AUTO_INCREMENT PRIMARY KEY,
    firstName VARCHAR(50) NOT NULL,
    lastName VARCHAR(50) NOT NULL,
    maidenName VARCHAR(50),
    age INT,
    gender ENUM('male', 'female', 'other'),
    email VARCHAR(100) NOT NULL,
    phone VARCHAR(20),
    username VARCHAR(50) NOT NULL,
    password VARCHAR(255) NOT NULL,
    birthDate DATE,
    image VARCHAR(255),
    bloodGroup VARCHAR(5),
    height FLOAT,
    weight FLOAT,
    eyeColor VARCHAR(20),
    hairColor VARCHAR(50),
    hairType VARCHAR(50),
    ip VARCHAR(45),
    address TEXT,
    city VARCHAR(50),
    state VARCHAR(50),
    stateCode VARCHAR(10),
    postalCode VARCHAR(20),
    country VARCHAR(50),
    macAddress VARCHAR(20),
    university VARCHAR(100),
    cardExpire VARCHAR(10),
    cardNumber VARCHAR(20),
    cardType VARCHAR(50),
    currency VARCHAR(10),
    iban VARCHAR(34),
    companyName VARCHAR(100),
    companyDepartment VARCHAR(50),
    companyTitle VARCHAR(50),
    companyAddress TEXT,
    ein VARCHAR(20),
    ssn VARCHAR(20),
    userAgent TEXT,
    cryptoCoin VARCHAR(50),
    cryptoWallet VARCHAR(100),
    cryptoNetwork VARCHAR(50),
    role VARCHAR(20)
);

